import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; 

import Startlearner from './pages/learnerform/startlearner'; 
import Learner1 from './learner1';
import Learner2 from './learner2';




const App = () => {
  return (

    <Router>
      <Routes> 

        <Route path="/" element={<Startlearner/>} />

        <Route path="learner1" element={<Learner1/>} /> 
        <Route path="learner2" element={<Learner2/>} /> 


      </Routes>
    </Router> 


  );
}

export default App;
